Нейтралите́т (нем. Neutralität, от лат. neuter — ни тот, ни другой), в международном праве — неучастие в войне, а в мирное время отказ от участия и неучастие в агрессивных военно-политических блоках и неприсоединение к ним, а также сокращение военных арсеналов и . В другом источнике указано, что Нейтралитет в международном праве - положение государства, не принимающего участия в войне между другими державами. Международное право нейтралитета содержит три ограничения на действия нейтральной государств и страны на время войны между другими государствами: 
* не предоставлять собственные вооружённые силы воюющим сторонам; 
* не предоставлять свою территорию для использования воюющим сторонам (базирование, транзит, перелёт и так далее); 
* не дискриминировать ни одну из сторон в поставках оружия и (то есть, ограничения либо одинаковые, либо вообще отсутствуют).
